import React from 'react'; 
import './rentalform.css'; 
import { useLocation } from 'react-router-dom';

const PurchaseForm = () => {

    const location = useLocation();
    const productInfoFromRental = location.state?.productInfoFromRental || [];
    const productInfoForPurchase = location.state?.productInfoForPurchase || []; 

    console.log('Received product info in Page 3:', productInfoFromRental);

    <div>
        <h1>Page 3: purchase form</h1>
        <pre>{JSON.stringify(productInfoFromRental, null, 2)}</pre>
        <pre>{JSON.stringify(productInfoForPurchase, null, 2)}</pre>
        <p>{productInfoForPurchase[0].price}</p>
    </div>
}

export default PurchaseForm;
